    title('Frequency and Phase Recovered')
    
    interpFactor = 8;
    xi = interp(x_freqCorrected, interpFactor);
    samps_per_sym = samps_per_sym*interpFactor;

    % find the best timing lag
    % do timing recovery 
    bestTau_max = 1;
    bestTau_min = 1;
    maxSigPow = -inf;
    minSigPow = inf;
    for tau=[1:samps_per_sym]
        sig = xi(tau:samps_per_sym:end);
        sigPow = sum(sig.^2);

        if(sigPow > maxSigPow)
            bestTau_max = tau;
            maxSigPow = sigPow;
        end

        if(sigPow < minSigPow)
            bestTau_min = tau;
            minSigPow = sigPow;
        end
    end

%     bestTau_max
%     bestTau_min

    bestTau = bestTau_max;

    fprintf('StartIdx=%d CFOEstimate=%f phEst=%f bestTau=%d\n', zzz, cfoEstimate, phEst, bestTau);
    
    % TODO: if bestTau is 1 OR samps_per_sym, need to do a different interp

    % interpolate for n points around the best timing estimate
    x_timingRecovered = [];
    jj = 1;
    for ii=1:samps_per_sym:length(xi)-samps_per_sym
        block = xi(ii:ii+samps_per_sym-1);

        % setup for edge conditions
        if(bestTau>1 && bestTau<samps_per_sym)
            idx_alpha = bestTau - 1;
            idx_beta = bestTau;
            idx_gamma = bestTau + 1;
        elseif(bestTau==1)
            idx_alpha = bestTau + 1;
            idx_beta = bestTau;
            idx_gamma = bestTau + 1;
        elseif(bestTau==samps_per_sym)
            idx_alpha = bestTau - 1;
            idx_beta = bestTau;
            idx_gamma = bestTau - 1;
        else
            error('Shouldnt be in here!\n');
        end
        alpha_re = real(block(idx_alpha));
        beta_re  = real(block(idx_beta));
        gamma_re = real(block(idx_gamma));
        y_re = qint(alpha_re,beta_re,gamma_re);

        alpha_im = imag(block(idx_alpha));
        beta_im  = imag(block(idx_beta));
        gamma_im = imag(block(idx_gamma));
        y_im = qint(alpha_im,beta_im,gamma_im);

        x_timingRecovered(jj) = y_re + j*y_im;
        jj = jj + 1;
    end

%     x_timingRecovered = xi(bestTau:samps_per_sym:end);

    subplot(2,2,2)
    scatter(real(x_timingRecovered), imag(x_timingRecovered))
    title('Frequency and Phase and Timing Recovered')
    % % % % % % title('Frequency and Phase Recovered')


    % perform phase recovery
    phEst = 1/4 * angle( sum( x_timingRecovered ).^4 );
    phCorr = exp(-j*phEst);
    x_phaseRecovered = phCorr * x_timingRecovered;
    subplot(3,1,1)
    title('Frequency and Phase and Timing Recovered')
    scatter(real(x_phaseRecovered), imag(x_phaseRecovered))

    [eqOut, eqErr] = equalize(x_phaseRecovered );
%     [eqOut, eqErr] = equalize( x_freqCorrected );
    subplot(2,2,3)
%     subplot(3,1,1)
    scatter(real(eqOut), imag(eqOut))
    title('Equalizer Output')
    
%     subplot(3,1,2)
%     scatter(1:length(eqOut), angle(eqOut))
%     title('Equalized Signal Phase vs Time')

    subplot(2,2,4)
%     subplot(3,1,3)
    plot(eqErr)
    title('Equalizer Error')

%     pause;
%     close all;
    
    phEstVec(zzz) = phEst;
    bestTauVec(zzz) = bestTau;

end

figure;
subplot(2,1,1)
plot(phEstVec)
title('Phase Est')
subplot(2,1,2)
plot(bestTauVec)
title('Best Tau')

end
